import React from 'react';
import {SidebarContainer, Icon, CloseIcon, SidebarLinks, SidebarLink} from './SidebarElements';

const Sidebar = () => {
  return (
      <>
      <SidebarContainer>
          <Icon>
              <CloseIcon />
          </Icon>
          <SidebarLinks>
              <SidebarMenu>
              <SidebarLink to='about'>About</SidebarLink>
              <SidebarLink to='projects'>Projects</SidebarLink>
              <SidebarLink to='technologies'>Technologies</SidebarLink>
              <SidebarLink to='contacts'>Contacts</SidebarLink>
              </SidebarMenu>
          </SidebarLinks>
      </SidebarContainer>
      </>
  );
};

export default Sidebar;
